import * as React from 'react';
import Checkbox from '@mui/material/Checkbox';
import { updateTask } from './until';

export default function ControlledCheckbox(id: any) {
  const [checked, setChecked] = React.useState(response.data.data.completed);

  const handleChange = async (event: React.ChangeEvent<HTMLInputElement>) => {
    setChecked(event.target.checked);
    console.log('id' ,id);

    try {
      const response = await updateTask(id);
      console.log("response file index", response.data.data.completed);
    } catch (error) {
      console.log('error', error);
    }
  };

  return (
    <Checkbox
      checked={checked}
      onChange={handleChange}
      inputProps={{ 'aria-label': 'controlled' }}
    />
  );
}
